import React from "react";
import "./searchResults.css"
import "./singleSeachResult"
import { OneSearchResult } from "./singleSeachResult";
import "bootstrap/dist/css/bootstrap.min.css"; 
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export const SearchResults = ({ results, deleteTrack, editTrack }) => {
    return (
        <Row className="justify-content-md-auto">
        <div>
            {results.map((result, id) => {
                return <Col><OneSearchResult 
                            result={result} 
                            key={id} 
                            id={result._id} 
                            deleteTrack={deleteTrack}
                            editTrack={editTrack}/></Col>   
            })}
        </div>
        </Row> 
    )
}
